     3→namespace App\Http\Services\Planes;
     4→
     5→use Exception;
     6→use App\Models\Planes\Plan;
     7→use Illuminate\Http\Request;
     8→use App\Http\Services\BaseService;
     9→use Illuminate\Support\Collection;
    10→use App\Http\Repositories\Planes\PlanRepository;
    11→use App\Http\Repositories\Pruebas\TipoPruebaRepository;
    12→use App\Http\Repositories\Planes\FuncionalidadPlanRepository;
    13→
    14→/**
    15→ * @property PlanRepository $repositorio
    16→ */
    17→class PlanService extends BaseService
    18→{
    19→    /**
    20→     * Constructor.
    21→     *
    22→     * @param PlanRepository $repositorio Repositorio de planes.
    23→     * @param TipoPruebaRepository $tipo_prueba_repositorio Repositorio de tipos de prueba.
    24→     * @param FuncionalidadPlanRepository $funcionalidad_plan_repositorio Repositorio de funcionalidades de planes.
    25→     * @return void
    26→     * @author Daniel Beltrán
    27→     */
    28→    public function __construct(
    29→        PlanRepository $repositorio,
    30→        protected TipoPruebaRepository $tipo_prueba_repositorio,
    31→        protected FuncionalidadPlanRepository $funcionalidad_plan_repositorio
    32→    ) {
    33→        parent::__construct($repositorio);
    34→    }
    35→
    36→    /**
    37→     * Guardar planes.
    38→     *
    39→     * @param Request $request Contenido de la petición.
    40→     * @return Plan
    41→     * @author Daniel Beltrán
    42→     */
    43→    public function guardar(Request $request): Plan {
    44→        $campos_excluidos = ['_token', '_method', 'id', 'funcionalidades', 'vigencia_selector'];
    45→
    46→        if (!$request->filled('unidades')) {
    47→            $request->merge(['unidades' => 0]);
    48→        }
    49→
    50→        if (!$request->filled('cantidad_ofertas_laborales')) {
    51→            $request->merge(['cantidad_ofertas_laborales' => 0]);
    52→        }
    53→
    54→        if ($request->filled('id')) {
    55→            $plan = $this->repositorio->actualizar($request->id, $request->except($campos_excluidos));
    56→        } else {
    57→            $plan = $this->repositorio->crear($request->except($campos_excluidos));
    58→        }
    59→
    60→        // Guardar las funcionalidades asociadas
    61→        if ($request->filled('funcionalidades')) {
    62→            $this->sincronizarFuncionalidades($plan, $request->funcionalidades);
    63→        }
    64→
    65→        return $plan;
    66→    }
    67→
    68→    /**
    69→     * Sincronizar funcionalidades.
    70→     *
    71→     * Esta función no se hizo directamente en el repositorio de planes porque hacerlo de esa forma no guarda los cambios en las auditorías y en este caso es necesario.
    72→     *
    73→     * @param Plan $plan Plan.
    74→     * @param array $funcionalidades ID's de las funcionalidades.
    75→     * @return void
    76→     * @author Daniel Beltrán
    77→     */
    78→    public function sincronizarFuncionalidades(Plan $plan, array $funcionalidades): void {
    79→        $plan->refresh();
    80→        $funcionalidades_existentes = $plan->funcionalidades->pluck('id')->toArray();
    81→
    82→        // Eliminar las funcionalidades que existen y no se recibieron
    83→        foreach ($funcionalidades_existentes as $item) {
    84→            if (!in_array($item, $funcionalidades)) {
    85→                $funcionalidad_plan = $this->funcionalidad_plan_repositorio->obtenerPorPlanYFuncionalidad($plan->id, $item);
    86→                $this->funcionalidad_plan_repositorio->eliminar($funcionalidad_plan->id);
    87→            }
    88→        }
    89→
    90→        // Agregar las funcionalidades que se reciben y aún no existen
    91→        foreach ($funcionalidades as $item) {
    92→            if (!in_array($item, $funcionalidades_existentes)) {
    93→                $this->funcionalidad_plan_repositorio->crear([
    94→                    'plan_id'          => $plan->id,
    95→                    'funcionalidad_id' => $item
    96→                ]);
    97→            }
    98→        }
    99→    }
   100→
   101→    /**
   102→     * Eliminar plan.
   103→     *
   104→     * @param int $id ID del plan.
   105→     * @return void
   106→     * @throws Exception
   107→     * @author Daniel Beltrán
   108→     */
   109→    public function eliminar(int $id): void {
   110→        // Validar que el plan no esté asignado
   111→        $plan = $this->repositorio->getUno($id);
   112→
   113→        if (count($plan->empresas) > 0) {
   114→            throw new Exception('No se puede eliminar el plan porque está asignado a una o más empresas');
   115→        }
   116→
   117→        $this->repositorio->eliminar($id);
   118→    }
   119→
   120→    /**
   121→     * Clonar plan.
   122→     *
   123→     * @param int $id ID del plan.
   124→     * @return Plan
   125→     * @author Daniel Beltrán
   126→     */
   127→    public function clonar(int $id): Plan {
   128→        $plan = $this->repositorio->getUno($id);
   129→
   130→        $nuevo_plan = $this->repositorio->crear([
   131→            'tipo_prueba_id'             => $plan->tipo_prueba_id,
   132→            'nombre'                     => $plan->nombre . ' (Copia)',
   133→            'descripcion'                => $plan->descripcion,
   134→            'unidades'                   => $plan->unidades,
   135→            'cantidad_ofertas_laborales' => $plan->cantidad_ofertas_laborales,
   136→            'vigencia'                   => $plan->vigencia,
   137→            'cantidad_usuarios'          => $plan->cantidad_usuarios,
   138→            'cantidad_pruebas'           => $plan->cantidad_pruebas,
   139→            'precio'                     => $plan->precio,
   140→            'en_promocion'               => $plan->en_promocion,
   141→            'porcentaje_descuento'       => $plan->porcentaje_descuento,
   142→            'fecha_inicio_promocion'     => $plan->fecha_inicio_promocion,
   143→            'fecha_fin_promocion'        => $plan->fecha_fin_promocion
   144→        ]);
   145→
   146→        // Clonar funcionalidades
   147→        $funcionalidades = $plan->funcionalidades->pluck('id')->toArray();
   148→        $this->sincronizarFuncionalidades($nuevo_plan, $funcionalidades);
   149→
   150→        return $nuevo_plan;
   151→    }
   152→
   153→    /**
   154→     * Obtener el historial de cambios.
   155→     *
   156→     * @param int $id ID de la empresa.
   157→     * @return Collection
   158→     * @author Daniel Beltrán
   159→     */
   160→    public function historialCambios(int $id): Collection {
   161→        $historial       = $this->repositorio->historialCambios($id);
   162→        $historial_final = [];
   163→
   164→        // Obtener los datos referenciados a través de llaves foráneas
   165→        $tipos_pruebas = $this->obtenerDatosReferenciados($historial, 'tipo_prueba_id', 'tipos_pruebas_ids', $this->tipo_prueba_repositorio);
   166→
   167→        foreach ($historial as $item) {
   168→            array_push($historial_final, [
   169→                'id'             => $item->id,
   170→                'user_type'      => $item->user_type,
   171→                'user_id'        => $item->user_id,
   172→                'event'          => $item->event,
   173→                'auditable_type' => $item->auditable_type,
   174→                'auditable_id'   => $item->auditable_id,
   175→                'created_at'     => $item->created_at,
   176→                'user'           => $item->user,
   177→                'old_values'     => $this->asignarCambiosHistorial($item->old_values, $tipos_pruebas),
   178→                'new_values'     => $this->asignarCambiosHistorial($item->new_values, $tipos_pruebas)
   179→            ]);
   180→        }
   181→
   182→        return collect($historial_final);
   183→    }
   184→
   185→    /**
   186→     * Asignar los cambios del historial.
   187→     *
   188→     * @param array $valores Valores del historial (pueden ser antigüos o nuevos).
   189→     * @param Collection $tipos_pruebas Tipos de pruebas.
   190→     * @return array
   191→     * @author Daniel Beltrán
   192→     */
   193→    private function asignarCambiosHistorial(array $valores, Collection $tipos_pruebas): array {
   194→        $valores_actualizados = [];
   195→
   196→        foreach ($valores as $llave => $valor) {
   197→            $valores_actualizados[$llave] = $valor;
   198→
   199→            if ($llave === 'tipo_prueba_id') {
   200→                $valores_actualizados[$llave] = $tipos_pruebas->firstWhere('id', $valor)->nombre;
   201→            }
   202→        }
   203→
   204→        return $valores_actualizados;
   205→    }
   206→
   207→    /**
   208→     * Obtener los datos para el Excel.
   209→     *
   210→     * @param Request $request Contenido de la petición.
   211→     * @return Collection
   212→     * @author Daniel Beltrán
   213→     */
   214→    public function datosExcel(Request $request): Collection {
   215→        $planes = $this->repositorio->getTodo($request);
   216→        $datos  = [];
   217→
   218→        foreach ($planes as $plan) {
   219→            $plan_actual                                  = $plan;
   220→            $plan_actual->funcionalidades_predeterminadas = implode(', ', $plan->funcionalidades->where('predeterminado', true)->pluck('nombre')->toArray());
   221→            $plan_actual->funcionalidades_adicionales     = implode(', ', $plan->funcionalidades->where('predeterminado', false)->pluck('nombre')->toArray());
   222→
   223→            array_push($datos, $plan_actual);
   224→            unset($plan_actual);
   225→        }
   226→
   227→        return collect($datos);
   228→    }
   229→}
