     5→use Exception;
     6→use Carbon\Carbon;
     7→use Illuminate\Support\Arr;
     8→use App\Traits\ArchivoTrait;
     9→use Illuminate\Http\Request;
    10→use App\Mail\CrearUsuarioMail;
    11→use Illuminate\Http\UploadedFile;
    12→use App\Http\Services\BaseService;
    13→use Illuminate\Support\Collection;
    14→use App\Models\Empresas\EmpresaPlan;
    15→use App\Models\Pruebas\TipoPrueba;
    16→use Illuminate\Support\Facades\Notification;
    17→use App\Http\Repositories\Planes\PlanRepository;
    18→use Illuminate\Support\Facades\{Mail, Password};
    19→use App\Http\Repositories\Permisos\RolRepository;
    20→use App\Http\Repositories\Usuarios\UserRepository;
    21→use App\Http\Repositories\Empresas\EmpresaRepository;
    22→use App\Http\Repositories\Planes\PlanCreditoRepository;
    23→use App\Http\Repositories\Empresas\EmpresaPlanRepository;
    24→use App\Notifications\SolicitudRenovacionPlanNotification;
    25→use App\Http\Repositories\Configuraciones\ArchivoRepository;
    26→use Symfony\Component\HttpFoundation\File\UploadedFile as SymfonyUploadedFile;
    27→
    28→/**
    29→ * @property EmpresaPlanRepository $repositorio
    30→ */
    31→class EmpresaPlanService extends BaseService
    32→{
    33→    use ArchivoTrait;
    34→
    35→    /**
    36→     * Constructor.
    37→     *
    38→     * @param EmpresaPlanRepository $repositorio Repositorio de planes de empresas.
    39→     * @param EmpresaRepository $empresa_repositorio Repositorio de empresas.
    40→     * @param RolRepository $rol_repositorio Repositorio de roles.
    41→     * @param PlanRepository $plan_repositorio Repositorio de planes.
    42→     * @param ArchivoRepository $archivo_repositorio Repositorio de archivos.
    43→     * @param UserRepository $usuario_repositorio Repositorio de usuarios.
    44→     * @return void
    45→     * @author Daniel Beltrán
    46→     */
    47→    public function __construct(
    48→        EmpresaPlanRepository $repositorio,
    49→        protected EmpresaRepository $empresa_repositorio,
    50→        protected RolRepository $rol_repositorio,
    51→        protected PlanRepository $plan_repositorio,
    52→        protected PlanCreditoRepository $plan_credito_repositorio,
    53→        protected ArchivoRepository $archivo_repositorio,
    54→        protected UserRepository $usuario_repositorio
    55→    ) {
    56→        parent::__construct($repositorio);
    57→    }
    58→
    59→    /**
    60→     * Guardar un plan de empresa.
    61→     *
    62→     * @param Request $request Contenido de la petición.
    63→     * @return EmpresaPlan
    64→     * @author Sergio Vargas
    65→     * @author Daniel Beltrán
    66→     * @author Andres Morales
    67→     * @author Jair Carvajal
    68→     */
    69→    public function guardar(Request $request): EmpresaPlan {
    70→        $bandera_enviar_correo = false;
    71→        $campos_excluidos      = ['_token', '_method', 'id', 'tipo_prueba_id', 'factura', 'vigencia', 'pruebas', 'funcionalidades'];
    72→        $plan                  = $this->plan_repositorio->getUno($request->plan_id);
    73→        $plan_activo           = $this->repositorio->planActivo($request->empresa_id, $request->tipo_prueba_id);
    74→        $vigencia              = $plan->vigencia;
    75→
    76→        if ($request->filled('plan_credito_id') && !$request->filled('creditos')) {
    77→            $plan_credito = $this->plan_credito_repositorio->getUno($request->plan_credito_id);
    78→
    79→            if ($plan_credito) {
    80→                $request->merge(['creditos' => $plan_credito->creditos]);
    81→            }
    82→        } elseif (!$request->filled('plan_credito_id')) {
    83→            $request->merge([
    84→                'plan_credito_id' => null,
    85→                'creditos'        => null
    86→            ]);
    87→        }
    88→
    89→        if ($request->filled('vigencia')) {
    90→            $vigencia = $request->vigencia;
    91→        }
    92→
    93→        if (!is_null($plan_activo)) {
    94→            if ($request->filled('id')) {
    95→                // Si el ID recibido es igual al plan activo, no se calcula vigencia
    96→                if ($request->id === $plan_activo->id) {
    97→                    goto omitir_calcular_vigencia;
    98→                }
    99→
   100→                // Si la vigencia no ha sido modificada respecto al plan base, no se calcula vigencia
   101→                if ($vigencia == $request->vigencia) {
   102→                    array_push($campos_excluidos, 'fecha_inicio', 'fecha_vencimiento');
   103→                    goto omitir_calcular_vigencia;
   104→                }
   105→            }
   106→
   107→            // Poner el nuevo plan como próximo
   108→            $request->merge(['estado_id' => 3]);
   109→
   110→            // Validar si el plan activo tiene fecha de vencimiento y el plan seleccionado tiene vigencia
   111→            if (!is_null($plan_activo->fecha_vencimiento) && !is_null($plan->vigencia)) {
   112→                // Agregar las nuevas fechas al nuevo plan
   113→                $hoy          = now();
   114→                $fecha_inicio = ($hoy > $plan_activo->fecha_vencimiento) ? $hoy->copy() : Carbon::createFromDate($plan_activo->fecha_vencimiento)->addDay();
   115→                $request->merge($this->calcularFechasVigencia($vigencia, $fecha_inicio));
   116→            }
   117→        } else {
   118→            $request->merge(['estado_id' => 1]);
   119→
   120→            // Validar si el plan seleccionado tiene vigencia
   121→            if (!is_null($plan->vigencia)) {
   122→                $request->merge($this->calcularFechasVigencia($vigencia));
   123→            }
   124→        }
   125→
   126→        omitir_calcular_vigencia:
   127→
   128→        if (!$request->filled('unidades')) {
   129→            $request->merge(['unidades' => $plan->unidades]);
   130→        } elseif ($request->unidades != $plan->unidades) {
   131→            $request->merge(['plan_original' => false]);
   132→        }
   133→
   134→        if (!$request->filled('cantidad_ofertas_laborales')) {
   135→            $request->merge(['cantidad_ofertas_laborales' => $plan->cantidad_ofertas_laborales]);
   136→        } elseif ($request->cantidad_ofertas_laborales != $plan->cantidad_ofertas_laborales) {
   137→            $request->merge(['plan_original' => false]);
   138→        }
   139→
   140→        if (!$request->filled('cantidad_usuarios')) {
   141→            $request->merge(['cantidad_usuarios' => $plan->cantidad_usuarios]);
   142→        } elseif ($request->cantidad_usuarios != $plan->cantidad_usuarios) {
   143→            $request->merge(['plan_original' => false]);
   144→        }
   145→
   146→        if (!$request->filled('cantidad_pruebas')) {
   147→            $request->merge(['cantidad_pruebas' => $plan->cantidad_pruebas]);
   148→        } elseif ($request->cantidad_pruebas != $plan->cantidad_pruebas) {
   149→            $request->merge(['plan_original' => false]);
   150→        }
   151→
   152→        // Comprobar si se modificaron las funcionalidades respecto al plan original
   153→        if (!is_null($plan->funcionalidades) && $request->filled('funcionalidades')) {
   154→            $funcionalidades_originales = $plan->funcionalidades->pluck('id')->toArray();
   155→            $primera_comparacion        = array_diff($request->funcionalidades, $funcionalidades_originales);
   156→            $segunda_comparacion        = array_diff($funcionalidades_originales, $request->funcionalidades);
   157→
   158→            if (count([...$primera_comparacion, ...$segunda_comparacion]) > 0) {
   159→                $request->merge(['plan_original' => false]);
   160→            }
   161→        }
   162→
   163→        if ($request->filled('id')) {
   164→            // Eliminar la factura actual
   165→            if ($request->hasFile('factura')) {
   166→                $archivo = $this->archivo_repositorio->obtenerPorModelo('App\Models\Empresas\EmpresaPlan', $request->id);
   167→
   168→                if (!is_null($archivo)) {
   169→                    $this->eliminarArchivoDesdeRuta($archivo->ruta);
   170→                    $this->archivo_repositorio->eliminar($archivo->id);
   171→                }
   172→            }
   173→
   174→            $plan_asignado = $this->repositorio->actualizar($request->id, $request->except($campos_excluidos));
   175→        } else {
   176→            $bandera_enviar_correo = true;
   177→            $request->merge(['usuario_id' => auth()->user()->id]);
   178→            $plan_asignado = $this->repositorio->crear($request->except($campos_excluidos));
   179→        }
   180→
   181→        if ($request->filled('pruebas')) {
   182→            $this->repositorio->sincronizarPruebas($plan_asignado, $request->pruebas);
   183→        }
   184→
   185→        if ($request->filled('funcionalidades')) {
   186→            $this->repositorio->sincronizarFuncionalidades($plan_asignado, $request->funcionalidades);
   187→        }
   188→
   189→        // Guardar la factura
   190→        if ($request->hasFile('factura')) {
   191→            $this->guardarFactura($plan_asignado->id, $request->empresa_id, $request->file('factura'));
   192→        }
   193→
   194→        if ($bandera_enviar_correo) {
   195→            $empresa      = $this->empresa_repositorio->getUno($request->empresa_id);
   196→            $usuario      = $empresa->usuarios[0];
   197→            $empresa_plan = $this->repositorio->getUno($plan_asignado->id);
   198→
   199→            $titulo = 'Usuario principal de la empresa creado';
   200→            Mail::send(new CrearUsuarioMail($usuario, Password::createToken($usuario), $titulo, $titulo, '', $empresa, $empresa_plan));
   201→        }
   202→
   203→        return $plan_asignado;
   204→    }
   205→
   206→    /**
   207→     * Renovar el plan asignado.
   208→     *
   209→     * @param int $id ID del plan de la empresa que se quiere renovar.
   210→     * @throws Exception Si el plan que se quiere renovar está en estado 'próximo'.
   211→     * @return EmpresaPlan Plan de la empresa renovado.
   212→     * @author Daniel Beltrán
   213→     */
   214→    public function renovar(int $id): EmpresaPlan {
   215→        $empresa_plan = $this->repositorio->getUno($id);
   216→
   217→        if ($empresa_plan->estado_id === 3) {
   218→            throw new Exception('No se puede renovar un plan que no ha entrado en vigencia');
   219→        }
   220→
   221→        $request = new Request(Arr::except($empresa_plan->toArray(), ['id', 'renovando', 'por_facturar', 'plan', 'estado', 'vigencia_dias']));
   222→        $request->merge(['por_facturar' => true]);
   223→
   224→        if (in_array($empresa_plan->estado_id, [1, 4])) {
   225→            // Cuando el plan actual está activo o por vencer, se asigna el estado 'próximo'
   226→            $request->merge(['estado_id' => 3]);
   227→        } elseif (in_array($empresa_plan->estado_id, [2, 5])) {
   228→            // Cuando el plan actual está inactivo o vencido, se asigna el estado 'activo'
   229→            $request->merge(['estado_id' => 1]);
   230→        }
   231→
   232→        $this->verificarYAsignarTiempo($empresa_plan, $request);
   233→        $plan_renovado = $this->repositorio->crear($request->toArray());
   234→
   235→        if ($request->filled('pruebas')) {
   236→            $this->repositorio->sincronizarPruebas($plan_renovado, $request->pruebas);
   237→        }
   238→
   239→        if ($request->filled('funcionalidades')) {
   240→            $this->repositorio->sincronizarFuncionalidades($plan_renovado, $request->funcionalidades);
   241→        }
   242→
   243→        return $plan_renovado;
   244→    }
   245→
   246→    /**
   247→     * Verificar si el plan es por tiempo y asignar el tiempo de vigencia en caso de serlo.
   248→     *
   249→     * @param EmpresaPlan $empresa_plan Plan de la empresa.
   250→     * @param Request $request Contenido de la petición.
   251→     * @return void
   252→     * @author Daniel Beltrán
   253→     */
   254→    public function verificarYAsignarTiempo(EmpresaPlan $empresa_plan, Request &$request): void {
   255→        if (!is_null($empresa_plan->fecha_inicio) && !is_null($empresa_plan->fecha_vencimiento)) {
   256→            $request->merge($this->calcularFechasVigencia($empresa_plan->plan->vigencia, $empresa_plan->fecha_vencimiento->addDay()));
   257→        }
   258→    }
   259→
   260→    /**
   261→     * Calcular las fechas en las que el plan estará vigente.
   262→     *
   263→     * @param int $vigencia Cantidad de días de vigencia.
   264→     * @param Carbon|null $fecha_inicio_vigencia Fecha en la que inicia la vigencia.
   265→     * @return array Fechas de inicio y vencimiento.
   266→     * @author Daniel Beltrán
   267→     */
   268→    public function calcularFechasVigencia(int $vigencia, ?Carbon $fecha_inicio_vigencia = null): array {
   269→        $hoy          = now();
   270→        $fecha_inicio = !is_null($fecha_inicio_vigencia) ? $fecha_inicio_vigencia : $hoy;
   271→
   272→        // Si es múltiplo de 3, entonces la vigencia es en meses
   273→        if (($vigencia % 3) === 0 && gettype($vigencia / 30) === 'integer') {
   274→            $meses             = $vigencia / 30;
   275→            $fecha_vencimiento = $fecha_inicio->copy()->addMonths($meses);
   276→
   277→            if ($fecha_inicio->day === 1) {
   278→                $fecha_vencimiento->subDay();
   279→            }
   280→        } else {
   281→            $vigencia          = $vigencia < 0 ? abs($vigencia) : $vigencia; // Convierte los valores negativos a positivos
   282→            $fecha_vencimiento = $fecha_inicio->copy()->addDays($vigencia);
   283→        }
   284→
   285→        return [
   286→            'fecha_inicio'      => $fecha_inicio->format('Y-m-d'),
   287→            'fecha_vencimiento' => $fecha_vencimiento->format('Y-m-d')
   288→        ];
   289→    }
