## Resumen Completo: Sistema de Renovación de Planes en PsicoAlianza

He investigado exhaustivamente el sistema de renovación de planes en el proyecto. Aquí está todo lo que encontré:

### 1. ESTRUCTURA DE ESTADOS DE PLANES

**Archivo:** `C:\Users\sergio\proyectos\Psicoalianza-2\database\seeders\EstadoPlanSeeder.php`

Los planes tienen 5 estados posibles (IDs):
- **Estado 1**: Activo
- **Estado 2**: Inactivo
- **Estado 3**: Próximo
- **Estado 4**: Por vencer
- **Estado 5**: Vencido

### 2. MÉTODO PRINCIPAL DE RENOVACIÓN

**Archivo:** `C:\Users\sergio\proyectos\Psicoalianza-2\app\Http\Services\Empresas\EmpresaPlanService.php` (líneas 206-244)

```php
public function renovar(int $id): EmpresaPlan {
    $empresa_plan = $this->repositorio->getUno($id);

    if ($empresa_plan->estado_id === 3) {
        throw new Exception('No se puede renovar un plan que no ha entrado en vigencia');
    }

    $request = new Request(Arr::except($empresa_plan->toArray(), 
        ['id', 'renovando', 'por_facturar', 'plan', 'estado', 'vigencia_dias']));
    $request->merge(['por_facturar' => true]);

    if (in_array($empresa_plan->estado_id, [1, 4])) {
        // Cuando el plan actual está activo o por vencer, se asigna el estado 'próximo'
        $request->merge(['estado_id' => 3]);
    } elseif (in_array($empresa_plan->estado_id, [2, 5])) {
        // Cuando el plan actual está inactivo o vencido, se asigna el estado 'activo'
        $request->merge(['estado_id' => 1]);
    }

    $this->verificarYAsignarTiempo($empresa_plan, $request);
    $plan_renovado = $this->repositorio->crear($request->toArray());

    if ($request->filled('pruebas')) {
        $this->repositorio->sincronizarPruebas($plan_renovado, $request->pruebas);
    }

    if ($request->filled('funcionalidades')) {
        $this->repositorio->sincronizarFuncionalidades($plan_renovado, $request->funcionalidades);
    }

    return $plan_renovado;
}
```

**VALIDACIÓN CRÍTICA (Línea 217-219):**
```php
if ($empresa_plan->estado_id === 3) {
    throw new Exception('No se puede renovar un plan que no ha entrado en vigencia');
}
```

### 3. LÓGICA DE CAMBIO DE ESTADO AL RENOVAR

- **Si el plan está en estado 1 (Activo) o 4 (Por vencer):** Se asigna estado 3 (Próximo)
- **Si el plan está en estado 2 (Inactivo) o 5 (Vencido):** Se asigna estado 1 (Activo)
- **Si el plan está en estado 3 (Próximo):** LANZA EXCEPCIÓN - No se puede renovar

### 4. MÉTODOS RELACIONADOS CON PLANES DE CRÉDITOS

**Archivo:** `C:\Users\sergio\proyectos\Psicoalianza-2\app\Http\Services\Empresas\EmpresaPlanService.php` (líneas 76-87)

```php
if ($request->filled('plan_credito_id') && !$request->filled('creditos')) {
    $plan_credito = $this->plan_credito_repositorio->getUno($request->plan_credito_id);

    if ($plan_credito) {
