### 5. REPOSITORIO: MÉTODOS PARA CONSULTAR PLANES ACTIVOS Y PRÓXIMOS

**Archivo:** `C:\Users\sergio\proyectos\Psicoalianza-2\app\Http\Repositories\Empresas\EmpresaPlanRepository.php`

**Método `planActivo()` (líneas 373-398):**
- Obtiene el plan activo (estado 1 o 4) para una empresa y tipo de prueba
- Incluye conteos de consumos de agendas, ofertas laborales y vacantes

**Método `planProximo()` (líneas 409-429):**
- Obtiene el próximo plan (estado 3) para una empresa y tipo de prueba

**Método `ultimoPlanAsignado()` (líneas 439-471):**
- Obtiene el último plan asignado con opciones de filtrado por estado

### 6. CÁLCULO DE VIGENCIA

**Archivo:** `C:\Users\sergio\proyectos\Psicoalianza-2\app\Http\Services\Empresas\EmpresaPlanService.php` (líneas 268-289)

```php
public function calcularFechasVigencia(int $vigencia, ?Carbon $fecha_inicio_vigencia = null): array {
    $hoy          = now();
    $fecha_inicio = !is_null($fecha_inicio_vigencia) ? $fecha_inicio_vigencia : $hoy;

    // Si es múltiplo de 3, entonces la vigencia es en meses
    if (($vigencia % 3) === 0 && gettype($vigencia / 30) === 'integer') {
        $meses             = $vigencia / 30;
        $fecha_vencimiento = $fecha_inicio->copy()->addMonths($meses);

        if ($fecha_inicio->day === 1) {
            $fecha_vencimiento->subDay();
        }
    } else {
        $vigencia          = $vigencia < 0 ? abs($vigencia) : $vigencia;
        $fecha_vencimiento = $fecha_inicio->copy()->addDays($vigencia);
    }

    return [
        'fecha_inicio'      => $fecha_inicio->format('Y-m-d'),
        'fecha_vencimiento' => $fecha_vencimiento->format('Y-m-d')
    ];
}
```

### 7. FLUJO DE ASIGNACIÓN DE PLANES (Método `guardar`)

**Archivo:** `C:\Users\sergio\proyectos\Psicoalianza-2\app\Http\Services\Empresas\EmpresaPlanService.php` (líneas 69-204)

**Lógica de estado según plan activo:**
- Si NO existe plan activo (líneas 117-124): Estado 1 (Activo) + calcular vigencia
- Si existe plan activo (líneas 93-116):
  - Si se actualiza el mismo plan (id igual): No cambiar vigencia
  - Si la vigencia no cambia: No recalcular fechas
  - Si la vigencia cambia: Estado 3 (Próximo) + calcular vigencia desde fecha de vencimiento del plan activo

### 8. MODELO EmpresaPlan

**Archivo:** `C:\Users\sergio\proyectos\Psicoalianza-2\app\Models\Empresas\EmpresaPlan.php`

**Campos importantes:**
- `plan_credito_id`: ID del plan de créditos (nullable)
- `creditos`: Cantidad de créditos (nullable)
- `estado_id`: Estado del plan (1-5)
- `fecha_inicio`, `fecha_vencimiento`: Vigencia temporal
- `unidades`: Cantidad de unidades disponibles
- `cantidad_ofertas_laborales`: Cantidad de ofertas laborales
- `por_facturar`: Flag para controlar facturas

**Atributo personalizado `creditos_restantes`:**
```php
public function getCreditosRestantesAttribute(): int {
    return max(0, $this->creditos - $this->consumosCreditos()->sum('creditos'));
}
```

### 9. CONTROLADOR EmpresaPlan

**Archivo:** `C:\Users\sergio\proyectos\Psicoalianza-2\app\Http\Controllers\Empresas\EmpresaPlanController.php`

Métodos relevantes:
- `formularioAsignar()`: Carga formulario para asignar plan
- `store()`: Asigna plan a empresa
- `formularioFacturar()`: Carga formulario para facturar
- `facturar()`: Factura plan de empresa
- `inactivar()`: Cambia estado a 2 (Inactivo)
- `solicitudRenovacionPlan()`: Envía notificación de solicitud de renovación (líneas 422-438)

### 10. HISTORIAL DE COMPRAS CON CRÉDITOS

**Método:** `historialComprasCreditos()` en EmpresaPlanService (líneas 372-385) y EmpresaPlanRepository (líneas 856-909)

Obtiene planes con `plan_credito_id` NOT NULL y calcula:
- Créditos totales
- Créditos consumidos
- Créditos restantes

### 11. VALIDACIONES IMPORTANTES

- **No se puede renovar un plan en estado "Próximo"** (estado_id = 3)
- Los planes de créditos se pueden comprar sin vigencia temporal
- El `por_facturar` flag marca si un plan necesita factura antes de activarse
- El cambio de estado es automático basado en el estado anterior

---

Esta arquitectura permite gestionar múltiples tipos de planes: algunos con vigencia temporal, otros por créditos, algunos por unidades, etc., todo dentro de un sistema de renovación robusto que valida transiciones de estado y gestiona automáticamente las fechas de vigencia.
